import logo from './logo.svg';
import '../App.css';
import Card from '../Card';
import Footer from '../Footer';
import Header from '../Header';
import ImagePopup from '../ImagePopup';
import Main from '../ImagePopup';
import PopupWithForm from '../PopupWithForm';

function App() {
  return (
    <div className="App">
<Card />
<Footer />
<Header />
<ImagePopup />
<Main />
<PopupWithForm />
    </div>
  );
}

export default App;
